INSERT INTO `producten` (`productnaam`, `beschrijving`, `prijs`, `image`) VALUES
('Sony Playstation VR', '\r\nHomeGaming, Film & MuziekGaming accessoiresVR-brillen\r\nSONY Playstation VR Megapack II + 5 Games\r\nSONY\r\n☆☆☆☆☆\r\n☆☆☆☆☆4.9 van de 5 sterren. Beoordelingen lezen van Playstation VR Megapack II + 5 Games \r\n4.9 9 beoordelingenMet deze actie navigeer je naar beoordelingen.\r\n1 van de 1 (100 %) beoordelaars bevelen dit product aan\r\nAlle productspecificaties\r\nSONY Playstation VR Megapack II + 5 Games\r\nGrotere afbeeldingen\r\nBeleef games alsof je er middenin zit met deze Sony PlayStation VR virtual reality gaming-bril. De bril laat je op een geheel nieuwe manier games ervaren waarbij de speler bijna letterlijk deel uit maakt van de actie. Met een helder OLED-scherm wat zorgt voor een vloeiend beeld van 120 Hz heb je 360 graden zicht om je omgeving te verkennen, daarnaast beschikt de PS VR over 3D-audio waardoor het geluid ook met je meedraait als je om je heen kijkt. Het ontwerp van de PlayStation VR is zo gemaakt dat je als speler bijna niet merkt dat hij er is, licht, comfortabel en gemakkelij', '297,87', ),
('Oculus Rift S', 'Het was één van de grootste Kickstarter-successen ooit en de voornaamste reden waarom VR zo gigantisch aan het groeien is: Oculus Rift. Wat begon als een droom om weg te stappen van de tv en je volledig te laten onderdompelen in jouw favoriete game is nu uitgegroeid tot de werkelijkheid. De Oculus Rift beschikt over 2 haarscherpe OLED-displays met een gezamenlijke resolutie van 2160 x 1200 met een refresh rate van 90 Hz. De ingebouwde accelerometer en gyroscoop volgen, in combinatie met de meegeleverde sensor, al jouw bewegingen en worden direct omgezet naar de game. Jij ziet wat jouw personage ziet met een gezichtsveld van 110°. Bij de Oculus Rift wordt een Xbox One-controller geleverd zodat je gelijk gaat gamen en wil je jezelf een nog realistischere ervaring voorschotelen, dan kan dat met de optionele Oculus Touch-controllers. Wel opletten dat je een pc hebt die de Oculus Rift aankan.\r\n', '616,50', ),
('Oculus Quest 128GB', 'De Oculus Quest 128GB is Oculus\' eerste actieve VR-bril zonder dat je een pc nodig hebt. Het enige wat je nodig hebt is de mobiele app om overal gebruik te maken van de Quest. Ook is de Quest draadloos, dus je zit niet langer vast aan de lengte van kabels. Bovenop zitten 4 camera\'s, die de omgeving scannen en op die manier voor de six degrees of freedom (6 DOF) zorgen. Deze techniek herkent wanneer je springt, draait of bukt en vertaalt dit op die manier naar de game die je speelt. Dit zorgt voor een nog realistischere ervaring dan ooit. Ook de controllers zijn nieuw en verbeterd, maar de lay-out is hetzelfde als bij de Oculus Rift controllers. Jong geleerd, oud gedaan dus voor degenen die weleens met de Rift in de weer zijn geweest.\r\n\r\n', '549,00', );
